import React from 'react'
import logo from "../img/logo.png"

const Footer = () => {
  return (
    <footer className='footer'>
      <img src = {logo} alt =""/>
      <span>Made by Nathan <b>React.js</b></span>
    </footer>
  )
}

export default Footer
